/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ObjectType {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_Unknown = 0;  
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_TrafficSign = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_TrafficLight = 2;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_TrafficLightBulb = 3;  // Bulbs inside a traffic light box
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_LaneMarking = 4;  // Traffic signs on the ground, such as turn signs, U-turn signs, etc.
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_StopLine = 5;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_SpeedBump = 6;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_Pole = 7;   // Line objects, such as light poles
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_CrossWalk = 8;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_Zone = 9;  // An area, such as an area under construction
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_ParkingSlot = 10;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_TrafficCone = 11;  // Safety cone
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_ParkingLockClose = 12;  // Closed ground lock
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_ParkingLockOpen = 13;  // Opened ground lock
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_ParkingColumn = 14;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_ParkingAFrameSign = 15;  // A-shaped warning sign
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_Junction = 16;  // junction of different roads
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_ParkingLock = 17;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_CementColumn_Yes = 18;  // Connected to the wall
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_CementColumn_No = 19;  // Not connected to the wall
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectType_ParkingRod = 20;  // Wheel bar for assisted parking
}

/**
* @brief BEV信息
