  ObjectShape_Rectangle = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectShape_Triangle = 2;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectShape_Round = 3;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectShape_Cylinder = 4;
