/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ObjectStatus {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_Unknown = 0;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_Off = 1;  // The traffic light is off
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_Invalid = 2;  // object is not available
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_Valid = 3;  // Object is available
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_TrafficLight_Green = 10;   // TrafficLight color
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_TrafficLight_Yellow = 11;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_TrafficLight_Red = 12;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStatus_TrafficLight_More_Color = 13;  // Colors other than red, yellow and green
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
