}


/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ObjectStage {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStage_Uninit = 0;  // The reconstructed object is not initialized
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStage_Unconverged = 1;  // The results of reconstructed objects do not converge
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStage_Converged = 2;  // The results of the reconstructed objects converged
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStage_UpdateError = 3;  // The reconstructed object update incorrectly
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStage_Lost = 4;  // The reconstruct object is lose tracking
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectStage_Fixed = 5;  // The results of the reconstructed is fixed
}


/**
* @brief BEV信息
