  ObjectOrientation_Back = 1;  // Object is facing away from the vehicle
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectOrientation_Side = 2;  // Object is facing the side of the vehicle
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ObjectOrientation_Front = 3;  // Object is facing the vehicle
}

