/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ParkingType {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_TYPE_UNKNOWN = 0;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_TYPE_VERTICAL = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_TYPE_PARALLEL = 2;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_TYPE_OBLIQUE = 3;
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message ParkingPoseInfo {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float width = 1; // width, correspond to entrance
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float length = 2; // length, correspond to side
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float angle = 3; // polygon interior angle
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float yaw_vcs = 4; // yaw, correspond to poly 03
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional VpPerceptionBaseProto.Point center_vcs = 5;  // center point under VCS coordinates
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated VpPerceptionBaseProto.Point poly_vcs = 6;  // 4 corner point under VCS coordinates
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated float poly_vcs_cov_x = 7; // 4 corner
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated float poly_vcs_cov_y = 8; // 4 corner
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ParkingOccupyStatus {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_OCCUPY_STATUS_UNKNOWN = 0;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_OCCUPY_STATUS_OCCUPIED = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_OCCUPY_STATUS_NOT_OCCUPIED = 2;
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ParkingLockStatus {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ParkingLockStatus_Unknown = 0;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ParkingLockStatus_Open = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  ParkingLockStatus_Close = 2;
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message ParkingLockInfo {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional bool valid = 1; // exist
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional VpPerceptionBaseProto.Point position_vcs = 2;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingLockStatus lock_status = 3;
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message ParkingOccupyInfo {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingOccupyStatus occupy_status = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingLockInfo lock_info = 2;  // parking lock info
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message ParkingRodInfo {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional bool valid = 1;  // exist
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated VpPerceptionBaseProto.Point end_vcs = 2; // 2 end point
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message ParkingBoundaryInfo {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated VpPerceptionBaseProto.Point point_vcs = 1;
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ParkingTrackStatus {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_TRACK_STATUS_UNKNOW = 0;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_TRACK_STATUS_PREDICTED = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  PARKING_TRACK_STATUS_CORRECTED = 2;
}


/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message ParkingSlotAttr {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 verify = 1;  // parking verify
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 source = 2;  // sensor source, bev,uss,lidar...
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingType type = 3;  // parking type
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingPoseInfo pose = 4;  // pose para
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingOccupyInfo occupy_info = 5;  // occupancy info
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingRodInfo rod_info = 6;   // rod info
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingBoundaryInfo boundary = 7;  // boundary,three points correspond to poly 12,23,30
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingTrackStatus track_status = 8; // predicted or corrected
}


/**
* @brief BEV信息
* @detail BEV最外层接口
*/
enum ObjectSource {
  // tracking state
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  OBJECT_SOURCE_UNKNOWN = 0;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  OBJECT_SOURCE_MEASURED = 1;  // The result of reconstructed object in the current frame is obtained by observation
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  OBJECT_SOURCE_PREDICTED = 2;   // The result of reconstructed object int the current frame is obtained by prediction
}

/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message Object {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 id = 1;
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional string str_id = 2;     // global id, UUID
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional VpNdmProtoV2.Polygon border = 3;  // The bounding box of the reconstructed object in VCS coordinate
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 type = 4;        // ObjectType
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 sub_type = 5;    // LaneMarkingType, TrafficSignType, etc.
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 conf = 6;        // confidence, 0~100
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 life_time = 7;   // The time since the object was detected (unit: ms)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 age = 8;         // The frame number since the object was detected
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ObjectAttr attr = 9;  // object attributes
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated string child_ids = 10;   // child object ids
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional VpNdmProtoV2.Point position = 11;  // object center position and covariance in VCS coordinate
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated int32 child_types = 12;  // only light, TrafficLightBulbType_CIRCLE | TrafficLightBulbType_LEFT_ARROW
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional bool in_cur_lane = 13;   // object in current lane flag
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional bool drive_start_up = 14;   // start_up flag (traffic light from red to green)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int64 generation_time = 15;  // time stamp when the object generates
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 submap_id = 16; // used for park mapping, mark which submap object belongs to
}


/**
* @brief BEV信息
* @detail BEV最外层接口
*/
message ObjectAttr {
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 shape = 1;       // ObjectShape
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional string value = 2;      // e.g. speed_limit value = "60"
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float cycle_time = 3;  // traffic light countdown (unit: s)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional bool dynamic = 4;      // Whether the static elements are variable, for example: variable speed limit signs
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 traversable = 5;   // Is it possible to cross
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float height = 6;      // The height of the object element in the vcs coordinate system (unit: m)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float radius = 7;      // cylinder, uint: m
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional int32 status = 8;      // object's status, see ObjectStatus
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional VpObstacleProto.ImageSpaceInfo img_info = 9;  // Information of the object on image
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated Condition conditions = 10;  // restricted conditions, such as speed limits, etc.
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional Orientation orientation = 11;  // Orientation of traffic lights/signs and etc.
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional TrafficLightStructType struct_type = 12;  // struct type of traffic light
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional TrafficLightBulbSpotMode spot_mode = 13; // spot mode for light bulb
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated TrafficLightBulbSpotMode spot_modes = 14;  // spot mode for light bulbs
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ObjectStage stage = 15;     // object's stage, see ObjectStage
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float pole_lift_angle = 16;  // Angle between target and ground
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ParkingSlotAttr parking_slot_attr = 17;  // parking attribute
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional PoleLiftState pole_lift_state = 18;  // toll pole lift state
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float length = 19;      // object's length (unit: m)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float width = 20;      // object's width (unit: m)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float sigma_height = 21;      // The uncertainty of the height of object (unit: m)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float sigma_length = 22;      // The uncertainty of the length of object (unit: m)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float sigma_width = 23;      // The uncertainty of the width of object (unit: m)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional ObjectSource obj_source = 24;  // ObjectSource
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  optional float ttc = 25;  // Collision time (unit: s)
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated TrafficLightBulbSpotMode bulb_modes = 26; // bulb flash
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated float bulb_cycle_times = 27; // bulb time
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated float bulb_confs = 28; // bulb conf
  ///< proto信息：[/],(0,0,1),[/],(1,0),proto信息
  repeated VpObstacleProto.ImageSpaceInfo bulb_img_infos = 29; // bulb 2d rect
}


/**
* @brief BEV信息
* @detail BEV最外层接口
*/
